//Global variables in SOAP UI
 //log
 //context
 //testRunner

 //to see all functions for testRunner class, include the following line.
 //Then run the script
 log.info testRunner.metaClass.methods*.name.unique().sort();

class Hello{

	//you MUST define the following 3 variables
	def log;
	def context;
	def testRunner;

	def Hello(log,context,testRunner){
		this.log = log;
		this.context = context;
		this.testRunner = testRunner;
	}

	def sayHello(){

		log.info("saying Hello");
	}
}

// 'Hello' class needs to be instantiated by calling the constructor like below:
context.setProperty("Hello", new Hello(log,context,testRunner));

//to get access to Test Steps in TestCase 1, do the following

project = testRunner.testCase.testSuite.project;
tcase = project.testSuites["TestSuite 3"].testCases["TestCase 1"];
hello = tcase.getTestStepByName("Hello");

hello.run(testRunner, context);

context.Hello.sayHello();

//to Run test step using Groovy from ANOTHER Test Case or Test Suite:
project = testRunner.testCase.testSuite.project;
tcase = project.testSuites["TestSuite 3"].testCases["TestCase 1"];
tstep = tcase.getTestStepByName("GetCountryISOCode");

//running Test Step
def status = tstep.run(testRunner,context);

//save status into a variable to print
def statusResult = status.getStatus().toString();
log.info("Status is: "+statusResult);

//get name of Test Case to run
def tcase = testRunner.testCase.testSuite.testCases["TestCase 1"];

//Running a Test Case
//create a property
def prop = new com.eviware.soapui.support.types.StringToObjectMap();
//run Test Case
runner = tcase.run(prop,true);

log.info("status: "+runner.getStatus().toString());

//get list of ALL Test Cases in a Test Suite
def testCases = context.testCase.testSuite.getTestCaseList()

testCases.each{
	log.info("Test case name: "+it.name)

//check for a particular test case name
if (it.name == "TestCase 3")
	log.info("This is Test Case 3");
}

//Test Case Name command
log.info("Current Test Case name: "+testRunner.testCase.name);

//to run another Test SUITE:
def tsuite = context.testCase.testSuite.project.testSuites["TestSuite2"];
tsuite.run(null,false); //null - property, false - async run

log.info("Test Suite: "+tsuite.getName().toString());

//run a DIFFERENT project, not the same one where this Groovy Script resides
def projName = testRunner.getTestCase().getTestSuite().getProject().getWorkspace().getProjectByName("REST Project 1");

//run
def runStatus = projName.run(null,true);

Thread.sleep(6000); //waiting for status to change from RUNNING to FINISHED
log.info("Status is: "+runStatus.getStatus().toString());
